import React, { Component } from 'react';
import { Radar } from 'react-chartjs-2';

const data = {
    labels: ["HP", "Attack", "Defense", "Sp. Atk", "Sp. Def", "Speed"],
    datasets: [{
        data: [20, 40, 30]
    }]
}

export default class RadarChart extends Component {
    render() {
        return (
            <Radar data={data}/>
        )
    }
}
